import React, { Component } from "react";
import "./App.css";
import { Button } from "react-bootstrap";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0
    };
  }
  render() {
    return (
      <div className="App">
        <div className="mt-2">
        <Button variant="outline-primary" size="lg">
          +
        </Button>
        <Button variant="outline-danger" size="lg">
          -
        </Button>
        </div>

      </div>
    );
  }
}
export default App;
